// Keyboard polling function
// Returns the key code of the key pressed, or -1 if no key was pressed
int PS2_poll() {
    static int break_code = 0; // Tracks if the last byte was a break code prefix
    int PS2_data = *(PS2_ptr); // Read the Data register in the PS/2 port
    int RVALID = PS2_data & 0x8000; // Extract the RVALID field

    if (RVALID) {
        char data_byte = PS2_data & 0xFF; // Extract the data byte

        if (data_byte == 0xF0) {
            // Break code detected, set the flag
            break_code = 1;
        } else {
            if (break_code) {
                // This is the key release byte
                break_code = 0;
                return -1; // Ignore key releases
            } else {
                // This is a key press, process it
                return data_byte; // Return the key press
            }
        }
    }
    return -1; // Return -1 if no valid key code was processed
}

// background1.c functions
void clear_screen() {
    for (int x = 0; x < 320; x++) {
        for (int y = 0; y < 240; y++) {
            plot_pixel(x, y, background_init[x][y]); // Use white as the background color
        }
    }
}

void plot_pixel(int x, int y, short int pixel_color) {
    volatile short int *pixel_address;
    pixel_address = (volatile short int *)(pixel_buffer_start + (y * 512 + x) * 2);
    *pixel_address = pixel_color;
}

void wait_for_vsync() {
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    *pixel_ctrl_ptr = 1; // Start synchronization
    while (*(pixel_ctrl_ptr + 3) & 0x01); // Wait for synchronization to complete
}

short int create_color(int r, int g, int b) {
    return ((r & 0x1F) << 11) | ((g & 0x3F) << 5) | (b & 0x1F);
}

void draw_sparks(int x, int y) {
    int num_sparks = 10;

    for(int i = 0; i < num_sparks; i++) {
        int dx = (rand() % 15) - 7;
        int dy = (rand() % 15) - 7;

        short int spark_color = create_color(31, 63, 0);

        int spark_x = x + dx;
        int spark_y = y + dy;
        if(spark_x >= 0 && spark_x < 320 && spark_y >= 0 && spark_y < 320) {
            plot_pixel(spark_x, spark_y, spark_color);
        }
    }
}

void erase_sparks(int x, int y) {
    for(int i = -8; i <= 8; i++) {
        for(int j = -8; j <= 8; j++) {
            int px = x+i;
            int py = y+j;
            if(px >= 0 && px < 320 && py >= 0 && py < 240) {
                plot_pixel(px, py, background_init[px][py]);
            }
        }
     }
}

