void swap(int *a, int *b) 
{
    int temp = *a;
    *a = *b;
    *b = temp;
}

void draw_line(int x_start, int y_start, int x_end, int y_end, short int line_color)
{
    bool is_steep = abs(y_end - y_start) > abs(x_end - x_start);
    if(is_steep) {
        swap(&x_start, &y_start);
        swap(&x_end, &y_end);
    }
    if(x_start > x_end) {
        swap(&x_start, &x_end);
        swap(&y_start, &y_end);
    }
    int deltax = x_end - x_start;
    int deltay = abs(y_end - y_start);
    int error = -(deltax / 2);
    int y = y_start;
    int y_step;
    if(y_start < y_end) {
        y_step = 1;
    } else {
        y_step = -1;
    }

    for (int x = x_start; x <= x_end; x++) {
        if(is_steep) {
            plot_pixel(y, x, line_color);
        } else {
            plot_pixel(x, y, line_color);
        }
        error = error + deltay;
        if(error > 0) {
            y = y + y_step;
            error = error - deltax;
        }
    }
}


void store_line(int x_start, int y_start, int x_end, int y_end, short int line_color)
{
    bool is_steep = abs(y_end - y_start) > abs(x_end - x_start);
    if(is_steep) {
        swap(&x_start, &y_start);
        swap(&x_end, &y_end);
    }
    if(x_start > x_end) {
        swap(&x_start, &x_end);
        swap(&y_start, &y_end);
    }
    int deltax = x_end - x_start;
    int deltay = abs(y_end - y_start);
    int error = -(deltax / 2);
    int y = y_start;
    int y_step;
    if(y_start < y_end) {
        y_step = 1;
    } else {
        y_step = -1;
    }

    for (int x = x_start; x <= x_end; x++) {
        if(is_steep) {
            //plot_pixel(y, x, line_color);
            background_init[y][x] = line_color;
        } else {
            //plot_pixel(x, y, line_color);
            background_init[x][y] = line_color;
        }
        error = error + deltay;
        if(error > 0) {
            y = y + y_step;
            error = error - deltax;
        }
    }
}

